import TimePicker from '@mui/lab/TimePicker';
// import img from "./image/b2.jpg"

const App = () => {

  return (
    <>
    <TimePicker
          label="Time"
          value={value}
          onChange={handleChange}
          renderInput={(params) => <TextField {...params} />}
        />
    
    </>
  )
}

export default App
